        body{
    background-color: cadetblue;
}

:root{
    --ani_time: 0.6s;
    --width: 200px;
}

div{
    background-color: rgb(255, 0, 0);
    height: 0.05px;
    width: 2px;
    margin-left: -8px;
}

div.w{
    border: 1px solid rgb(255, 255, 255);
    transform: translateY(-18px);
    box-shadow: 0px 10px 4px gold;
}

div.track{
    width: 12px;
    height: 12px;
    border-radius: 50%;
    position: absolute;
    background-color: white;
    animation: track var(--ani_time) ease-in-out 0.09s infinite alternate;
    transform: translateX(-8px) translateY(-14px);
    z-index: 10;
}

@keyframes one{
    from{
        width: 2px;
        background-color: rgb(255, 255, 255);
    }
    
    to{
        width: var(--width);
        background-color: rgb(255, 255, 255);
    }
}

@keyframes track {
    from{
        margin-left: 0px;
    }
    to{
        margin-left: var(--width);
    }
}
